import React from 'react';
import PropTypes from 'prop-types';

const Project = () => {
  const projects = [
    {
      title: "AgroMaart - Online Fertilizer Shop",
      icon: "ri-shopping-cart-fill",
      description: "Built a user-friendly web application...",
      additionalInfo: "Technologies: Spring Boot, Hibernate, MySQL, React, HTML, CSS",
      imageSrc: require('../../assets/images/AgroMart.webp'),
      animation: "fade-left",
    },
    {
      title: "Students Management System",
      icon: "ri-book-2-fill",
      description: "The Students Management System is a web-based application...",
      additionalInfo: "Technologies: Spring Boot, Hibernate, Thymeleaf, MySQL",
      imageSrc: require('../../assets/images/studentManagementSystem.webp'),
      animation: "fade-left",
    },
    {
      title: "Employee Management System",
      icon: "ri-user-3-fill",
      description: "A Java-based system utilizing MySQL and Hibernate...",
      additionalInfo: "Technologies: Java, MySQL, Hibernate",
      animation: "fade-left",
    },
    {
      title: "Akshay Balte Portfolio",
      icon: "ri-portfolio-fill",
      description: "A portfolio website built with React, JavaScript, HTML, and CSS...",
      additionalInfo: "Technologies: React, JavaScript, HTML, CSS",
      animation: "fade-left",
    },
  ];

  return (
    <section id="project" style={styles.section}>
      <div style={styles.container}>
        <div style={styles.sectionHeader}>
          <h2 style={styles.sectionTitle}>Projects</h2>
        </div>
        <div style={styles.projectsGrid}>
          {projects.map((project, index) => (
            index % 2 === 0 && (
              <div key={index} style={styles.row}>
                <TimelineCard {...projects[index]} />
                {projects[index + 1] && <TimelineCard {...projects[index + 1]} />}
              </div>
            )
          ))}
        </div>
      </div>
    </section>
  );
};

const TimelineCard = ({ title, icon, description, additionalInfo, imageSrc, animation }) => {
  return (
    <div className="timeline-card" style={styles.cardContainer} data-aos={animation}>
      <div style={styles.iconContainer}>
        {imageSrc && <img src={imageSrc} alt={title} style={styles.iconImage} />}
      </div>
      <div style={styles.cardContent}>
        <h3 style={styles.cardTitle}><i className={`${icon} mr-2`}></i> {title}</h3>
        <p style={styles.cardDescription}>{description}</p>
        <p style={styles.cardAdditionalInfo}>{additionalInfo}</p>
      </div>
    </div>
  );
};

TimelineCard.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
  description: PropTypes.string.isRequired,
  additionalInfo: PropTypes.string,
  imageSrc: PropTypes.string,
  animation: PropTypes.string.isRequired,
};

const styles = {
  section: {
    padding: '4rem 2rem',
    background: 'linear-gradient(135deg, #d7e9f7, #e1f5fe)',
    borderRadius: '1rem',
    boxShadow: '0 8px 20px rgba(0, 0, 0, 0.1)',
  },
  container: {
    maxWidth: '1100px',
    margin: '0 auto',
  },
  sectionHeader: {
    textAlign: 'center',
    marginBottom: '3rem',
  },
  sectionTitle: {
    color: '#0288d1',
    fontWeight: '600',
    fontSize: '2.8rem',
    textTransform: 'uppercase',
  },
  projectsGrid: {
    display: 'flex',
    flexDirection: 'column',
    gap: '2rem',
  },
  row: {
    display: 'flex',
    gap: '2rem',
  },
  cardContainer: {
    flex: 1,
    display: 'flex',
    alignItems: 'center',
    gap: '1rem',
    padding: '1.5rem',
    borderRadius: '1rem',
    boxShadow: '0 6px 16px rgba(0, 0, 0, 0.1)',
    transition: 'transform 0.3s ease, box-shadow 0.3s ease',
  },
  iconContainer: {
    flexShrink: 0,
  },
  iconImage: {
    width: '80px',
    height: '80px',
    objectFit: 'cover',
    borderRadius: '50%',
  },
  cardContent: {
    flex: 1,
  },
  cardTitle: {
    fontWeight: '700',
    fontSize: '1.8rem',
    color: '#0277bd',
  },
  cardDescription: {
    fontSize: '1rem',
    color: '#455a64',
    marginTop: '0.75rem',
  },
  cardAdditionalInfo: {
    fontSize: '0.9rem',
    color: '#607d8b',
    fontStyle: 'italic',
  },
};

export default Project;
